import React from "react";
import { FaCheck, FaCheckDouble } from 'react-icons/fa';

const RecMsg = (props) => {
    return (
        <div className={"text-white p-3 bg-black flex flex-col max-w-[70%] rounded-lg w-max"}>
            <p>{props.name}</p>
            <p>{props.phoneno}</p>
            <p>{props.msg}</p>
            <div className={"flex justify-end items-end"}><p className={"justify-end"}>{props.time} {<FaCheckDouble className={"text"}></FaCheckDouble>}</p></div>
        </div>
    );
    
}

export default RecMsg;
